import React from "react";

class Text extends React.Component{
    render() {
        return(
            <div>
                 <div>What kind of stuff you accept?</div> 
                 <div>We accept everything that can be put</div>
                 <div>in a small truck inckuding furniture,</div>      
                 <div>electronics, clothes and so on.</div>             
            </div>
        );
     }
}

export default Text;
